import React, { Component, Fragment } from 'react';

const BASE_PATH = 'https://www.cbr-xml-daily.ru/daily_utf8.xml';

class Data {
  async init() {
    this.fetchData();
  }

  fetchData() {
    fetch(BASE_PATH)
      .then((response) => response.json())
      .then((result) => this.setData(result));

  }
}

export default Data;
